import { useEffect, useState } from "react";

function APP(){
  const [routes, setRoutes] = useState([]);
  useEffect(() =>{
    fetch("http://127.0.0.1:8000/api/routes/")
    .then(res => res.json())
    .then(data => setRoutes(data));
  }, []);

  const bookTicket = () => {
    fetch("http://127.0.0.1:8000/api/book", {
      method: "POST",
      headers: { "Content=Type": "application/json" },
      body: JSON.stringify({
        user: 1,
        schedule: 1,
        seats: 1
      })
    })
    .then(res => res.json())
    .then(data => console.log(data));
  };

  return(
    <div>
      <h1>Available routes</h1>

      {routes.map(route =>(
        <div key={route.id}>
          <p>
            {route.from_location} - {route.to_location} | Tsh {route.price}
          </p>
          <button onClick={bookTicket}>
            Book Ticket
          </button>
          </div>
      ))}
      </div>
  );
}

export default APP;
